import Logo from "./Logo";
import {Button} from "react-bootstrap";

const Header = (props) => {
  return (
    <>
      <nav class="header navbar-expand-lg navbar-dark bg-primary">
        <div class="row">
          <div class="col-2">
            <Logo />
          </div>
          <div class="col-8">
            <h1 class="title">React Pok√© Dex</h1>
          </div>

          <div class="col-2">
            <Button>Log In</Button>
            <Button>Register</Button>
          </div>
        </div>
      </nav>
    </>
  );
};

export default Header;
